INSERT INTO `core_compentancies` (`id`, `banner_image`, `title`, `summary`, `gallery`, `created_at`, `updated_at`) VALUES
(1, 'uploads/blogs/serve/942161688553608.jpg', 'Core Compentancy', '<p style=\"margin-bottom: 0px; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; color: rgb(33, 33, 33); font-family: Montserrat; font-size: 15px;\">Srii Balaji group has globally diversified operations at a low cost. We aspire to empower our people to drive excellence and innovation to create value for our stakeholders. We have the best world-class standards of governance, safety, sustainability, and social responsibility.</p><p style=\"margin-bottom: 0px; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; color: rgb(33, 33, 33); font-family: Montserrat; font-size: 15px;\">Post-Covid, the world has come to a virtual standstill, and protecting the environment has gained tremendous importance. Having one of the largest EWASTE refineries in India, we wish to inculcate the habit of making the environment clean and green.</p><p style=\"margin-bottom: 0px; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; color: rgb(33, 33, 33); font-family: Montserrat; font-size: 15px;\">We process the worlds biggest electronic waste into precious and semi-precious metals.</p><p style=\"margin-bottom: 0px; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; color: rgb(33, 33, 33); font-family: Montserrat; font-size: 15px;\">We teach our employees to work with team spirit to increase productivity with team effort.</p><p style=\"margin-bottom: 0px; border: 0px; outline: 0px; -webkit-font-smoothing: antialiased; color: rgb(33, 33, 33); font-family: Montserrat; font-size: 15px;\">As a group, we want to make every Indian aware that a clean and green environment will create more prosperity and growth for the country and themselves.</p>', NULL, NULL, '2023-07-05 05:11:17');
