INSERT INTO `founder_models` (`id`, `founder_note`, `video`, `founder_image`, `founder_content_heading`, `created_at`, `updated_at`) VALUES
(1, '<p><span style=\"color: rgb(33, 37, 41); font-family: Avenir; font-size: 15.9959px; letter-spacing: 0.99718px;\">Call it our passionate optimism, but we genuinely believe all of us harbour good intentions when it comes to looking out for our own home. Somewhere in the frenzy of the rat-race around us, its the outcome of those intentions that has taken a hit. As we all inch towards securing our future we drift farther away from the delicate relationship we share with nature. All the rising environmental crises are a result of this very rift. Through Ek Saath, we embark upon a journey to bridge that very gap and replenish this deteriorating relationship. Everything that we put out in nature unmistakably finds its way back to us again in one way or another. We try to guide our lives by the enlightening philosophies of Karma. If only we learn to apply the same logic to our relationship with our environment, wed know that the only true salvation is a better tomorrow and the only promised heaven is here on our beloved earth. There are those who are yet oblivious to the far-reaching impact their actions have on the planet. While the ones already aware, simply dont know any better. Were not in the business of picking culprits out of victims for we stand to celebrate the very spirit of togetherness. If theres anything to learn from our past then&nbsp;its the valuable lesson of how we learnt to overcome the darkest of times only by coming together. We seek to revive this very force in our pursuit by empowering all the lives we touch in our own humble ways. In our finite time here, all of us are capable of making an infinite difference. The time has come when just hoping for a better future wont cut it until we step up to make it happen. Or as a wise kindred spirit once sang,</span><br style=\"color: rgb(33, 37, 41); font-family: Avenir; font-size: 15.9959px; letter-spacing: 0.99718px;\"><span style=\"color: rgb(33, 37, 41); font-family: Avenir; font-size: 15.9959px; letter-spacing: 0.99718px;\">You may say I\'m a dreamer</span><br style=\"color: rgb(33, 37, 41); font-family: Avenir; font-size: 15.9959px; letter-spacing: 0.99718px;\"><span style=\"color: rgb(33, 37, 41); font-family: Avenir; font-size: 15.9959px; letter-spacing: 0.99718px;\">But I\'m not the only one</span><br style=\"color: rgb(33, 37, 41); font-family: Avenir; font-size: 15.9959px; letter-spacing: 0.99718px;\"><span style=\"color: rgb(33, 37, 41); font-family: Avenir; font-size: 15.9959px; letter-spacing: 0.99718px;\">I hope some day you\'ll join us</span><br style=\"color: rgb(33, 37, 41); font-family: Avenir; font-size: 15.9959px; letter-spacing: 0.99718px;\"><span style=\"color: rgb(33, 37, 41); font-family: Avenir; font-size: 15.9959px; letter-spacing: 0.99718px;\">And the world will be as one..</span><br></p>', NULL, 'uploads/blogs/serve/357001677730380.jpg', 'Pragya Kapoor', NULL, '2023-03-02 04:14:11');
