(13, 'Antimony', '<p style=\"box-sizing: inherit; color: rgb(41, 41, 41); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Do you use makeup in your daily life? Whether you put it on when you go to a party, for a play you?re in, or to complete your Halloween costume, our metal of the month might be of interest for you. Antimony compounds have been used since ancient times: Egyptian women used stibnite, antimony sulphide known as kohl, as a cosmetic to blacken their eyes and eyebrows.&nbsp;</p><p style=\"box-sizing: inherit; color: rgb(41, 41, 41); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Historically, the ancients thought that this powder, derived from crushed antimony, &nbsp;helped cure eye infections. This practice is still seen in Yemen and in other countries.</p><h2 style=\"box-sizing: inherit; margin-bottom: 1rem; line-height: 1.4; word-break: break-word; font-family: ff-dax-pro, sans-serif; color: rgb(0, 104, 168); font-size: 1.563rem;\">Applications</h2><p style=\"box-sizing: inherit; color: rgb(41, 41, 41); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Because of its excessive brittleness and the difficulty of shaping it, antimony (Sb) has no direct applications, but is extensively used as an alloying element to improve the hardness and strength of other metals. So antimony is present in lead-acid batteries to harden the lead of which the electrodes (grids) are made. Hard lead contains 15-25% Sb. In addition, type metal contains 60% Pb, 20-30% Sb and 10-20% tin, but this application has virtually disappeared as a result of the development of the offset printing process.</p><p style=\"box-sizing: inherit; color: rgb(41, 41, 41); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Antimony is used in the electronics industry to make certain types of semiconductor devices, such as infrared detectors and diodes.</p><p style=\"box-sizing: inherit; color: rgb(41, 41, 41); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">It is also present in certain Pb?Sn?Sb anti-friction metals used to make bearings for large compressors and propeller shafts. The sulphide Sb2S3 is one of the components of brake linings. The intermetallic compounds AsSb, GaSb and InSb have found some applications in electronics. The main outlet -? accounting for around 50% of total antimony consumption - is in the form of the oxide Sb2O3, which is used to render fabrics, plastics, paints and other substances fireproof. Antimony compounds act as a co-synergist with halogenated flame retardants to enhance their effectiveness. Its properties make it possible for plastics to be used in applications where they would melt under normal circumstances, such as in computer casings and televisions.</p><p style=\"box-sizing: inherit; color: rgb(41, 41, 41); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Umicore Precious Metals Refining produces sodium antimonate, a compound used in certain special glasses, mostly solar PV glass. As a fining agent, antimony ions interact with oxygen, suppressing the tendency of the latter to form (large) bubbles.&nbsp;</p><h2 style=\"box-sizing: inherit; margin-bottom: 1rem; line-height: 1.4; word-break: break-word; font-family: ff-dax-pro, sans-serif; color: rgb(0, 104, 168); font-size: 1.563rem;\">Recycling</h2><p style=\"box-sizing: inherit; color: rgb(41, 41, 41); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Generally speaking, the main end-of-life recycling option is from spent lead-acid batteries, where antimony is directly recovered as a lead-antimony alloy.&nbsp;</p><p style=\"box-sizing: inherit; color: rgb(41, 41, 41); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">At Umicore Precious Metals Refining in Hoboken (Belgium), antimony is recovered from complex lead-bearing concentrates as well as various complex residues from the lead/copper/zinc industry. The antimony is extracted during the lead refining process in the form of sodium antimonate.</p><h2 style=\"box-sizing: inherit; margin-bottom: 1rem; line-height: 1.4; word-break: break-word; font-family: ff-dax-pro, sans-serif; color: rgb(0, 104, 168); font-size: 1.563rem;\"><br style=\"box-sizing: inherit;\">Properties</h2><p style=\"box-sizing: inherit; color: rgb(41, 41, 41); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Antimony is a very hard, brittle and bluish-white metal with a highly distinct crystalline texture. Antimony is not an abundant element but is found in small quantities in over 100 mineral species. It is most often found as antimony(III) sulfide but also occurs as the native metal.</p><p style=\"box-sizing: inherit; color: rgb(41, 41, 41); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Like arsenic, there are various allotropes, one of which, yellow antimony, occurs only at temperatures below ?80?C and is liable to explode.</p><p style=\"box-sizing: inherit; color: rgb(41, 41, 41); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Another allotrope, black antimony, crystallizes in the rhombohedral system and exhibits a metallic luster but is extremely brittle and much less volatile than arsenic.<br style=\"box-sizing: inherit;\"></p>', 'uploads/blogs/serve/170971688817836.png', 'uploads/blogs/serve/947031688817836.webp', 'antimony', 1, 1, '2023-07-08 12:03:56', '2023-07-08 12:10:22'),
(14, 'Arsenic', '<div class=\"block block-header\" style=\"box-sizing: inherit; margin-top: 0px; color: rgb(41, 41, 41); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\"><div class=\"row justify-content-center\" style=\"box-sizing: inherit;\"><div class=\"col-lg-8\" style=\"box-sizing: inherit; min-height: 1px; width: 760px; flex-basis: 66.6667%; max-width: 66.6667%;\"><h1 style=\"box-sizing: inherit; margin-bottom: 1rem; line-height: 1.4; word-break: break-word; font-family: ff-dax-pro, sans-serif; color: rgb(0, 104, 168); font-size: 2.5rem;\">Arsenic</h1></div></div></div><div class=\"block block-text\" style=\"box-sizing: inherit; margin-top: 0px; color: rgb(41, 41, 41); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\"><div class=\"row justify-content-md-center\" style=\"box-sizing: inherit;\"><div class=\"col col-lg-8\" style=\"box-sizing: inherit; min-height: 1px; width: 760px; flex-basis: 66.6667%; max-width: 66.6667%;\"><div class=\"wysiwyg\" style=\"box-sizing: inherit;\"><p style=\"box-sizing: inherit;\">The two natural arsenic sulphides - realgar (brownish-red) and orpiment (lemon yellow) - have been known since ancient times. The Greeks gave them the name , which means male. This etymology was related to the ancient concept of putting metals into the categories of male and female depending on whether they reacted easily or not with other metals. Subsequently, the word arsenic was given to the metal itself.<br style=\"box-sizing: inherit;\"><br style=\"box-sizing: inherit;\">There are indications that arsenic was isolated in the 13th century, but Berzelius was the first to undertake systematic research on the element and its compounds in the early part of the 19th century.<br style=\"box-sizing: inherit;\"><br style=\"box-sizing: inherit;\"></p><h2 style=\"box-sizing: inherit; margin-bottom: 1rem; line-height: 1.4; word-break: break-word; font-family: ff-dax-pro, sans-serif; color: rgb(0, 104, 168); font-size: 1.563rem;\">Properties</h2><ul style=\"box-sizing: inherit;\"><li style=\"box-sizing: inherit;\">At atmospheric pressure, arsenic sublimates at around 600C.</li><li style=\"box-sizing: inherit;\">It can be obtained in the liquid form only under pressure.</li><li style=\"box-sizing: inherit;\">Arsenic vapour consists of As4 molecules up to 800C, then of As2 molecules and, finally, of As at 1700C.</li><li style=\"box-sizing: inherit;\">When heated in air, at temperatures of 200C and above, arsenic gives off volatile arsenious anhydride, which smells of garlic.<br style=\"box-sizing: inherit;\"><br style=\"box-sizing: inherit;\"></li></ul><h2 style=\"box-sizing: inherit; margin-bottom: 1rem; line-height: 1.4; word-break: break-word; font-family: ff-dax-pro, sans-serif; color: rgb(0, 104, 168); font-size: 1.563rem;\">Applications</h2><p style=\"box-sizing: inherit;\">Arsenic\'s major application is a&nbsp;<span style=\"box-sizing: inherit; font-weight: bolder;\">wood preservative</span>.&nbsp;Additionally, the trioxide is used as a decolouriser and refining agent in&nbsp;<span style=\"box-sizing: inherit; font-weight: bolder;\">glass-making</span>, and methylated derivatives are used as&nbsp;<span style=\"box-sizing: inherit; font-weight: bolder;\">herbicides</span>.</p><p style=\"box-sizing: inherit;\">Arsenic metal is also used as an&nbsp;<span style=\"box-sizing: inherit; font-weight: bolder;\">alloying element</span>&nbsp;in certain lead- and copper-base alloys as well as in the manufacture of lead shot. Almost 97% of arsenic is used in the form of the oxide As4O6, a by-product of lead and copper metallurgy.<br style=\"box-sizing: inherit;\"><br style=\"box-sizing: inherit;\"></p><h2 style=\"box-sizing: inherit; margin-bottom: 1rem; line-height: 1.4; word-break: break-word; font-family: ff-dax-pro, sans-serif; color: rgb(0, 104, 168); font-size: 1.563rem;\">Recycling</h2><p style=\"box-sizing: inherit;\">Small volumes of arsenic are recovered in electronic scrap such as used circuit boards, relays, switches etc. Gallium-arsenide scrap is also recovered from semiconductor manufacturing.</p></div></div></div></div>', 'uploads/blogs/serve/314491688885739.jpg', 'uploads/blogs/serve/559981688885739.webp', 'arsenic', 1, 1, '2023-07-09 06:54:11', '2023-07-09 06:55:39'),
(15, 'Bismuth', '<div class=\"block block-header\" style=\"box-sizing: inherit; margin-top: 0px; color: rgb(41, 41, 41); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\"><div class=\"row justify-content-center\" style=\"box-sizing: inherit;\"><div class=\"col-lg-8\" style=\"box-sizing: inherit; min-height: 1px; width: 760px; flex-basis: 66.6667%; max-width: 66.6667%;\"><h1 style=\"box-sizing: inherit; margin-bottom: 1rem; line-height: 1.4; word-break: break-word; font-family: ff-dax-pro, sans-serif; color: rgb(0, 104, 168); font-size: 2.5rem;\">Bismuth</h1></div></div></div><div class=\"block block-text\" style=\"box-sizing: inherit; margin-top: 0px; color: rgb(41, 41, 41); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\"><div class=\"row justify-content-md-center\" style=\"box-sizing: inherit;\"><div class=\"col col-lg-8\" style=\"box-sizing: inherit; min-height: 1px; width: 760px; flex-basis: 66.6667%; max-width: 66.6667%;\"><div class=\"wysiwyg\" style=\"box-sizing: inherit;\"><p style=\"box-sizing: inherit;\">Bismuth was first used many years ago! &nbsp;The Incas combined this metal with copper and tin to produce knives and in Ancient Egypt, bismoclite was often used for cosmetic purposes. However, industrial production of the metal did not begin until around 1830.</p><p style=\"box-sizing: inherit;\">Today, bismuth is found in an application that is very useful to our local heroes. Can you guess who often uses this metal at work? Firefighters! Due to its low melting point, bismuth is used in fire detectors and extinguishers. So you probably have some bismuth in your home, ready to alert the authorities if fire breaks out.<br style=\"box-sizing: inherit;\"><br style=\"box-sizing: inherit;\"></p><h2 style=\"box-sizing: inherit; margin-bottom: 1rem; line-height: 1.4; word-break: break-word; font-family: ff-dax-pro, sans-serif; color: rgb(0, 104, 168); font-size: 1.563rem;\">Applications</h2><p style=\"box-sizing: inherit;\">Metallic bismuth is used principally in alloys. However, it is also found in the pharmaceutical industry. A component called bismuth citrate is included in antibiotics that are effective against bacteria that cause stomach ulcers, for example. Bismuth is also found in other components linked to treating stomach aches, swelling or eye infections.</p><p style=\"box-sizing: inherit;\">Due to its low melting point, it is used in electric fuses, solders and occasionally to make molds in the thermoplastic materials industry. Besides lighting your home, it can also add some color: about 300 tons of bismuth a year are used as pigments in paints. One of these produces the bright yellow colors used in the automotive industry.</p><p style=\"box-sizing: inherit;\">If you dont have enough color, you can apply a little highlighter. Many cosmetics, including eyeshadows, lipsticks and nail polish, contain bismuth oxychloride to give the products their pearl-like luster.&nbsp;<br style=\"box-sizing: inherit;\"><br style=\"box-sizing: inherit;\"></p><h2 style=\"box-sizing: inherit; margin-bottom: 1rem; line-height: 1.4; word-break: break-word; font-family: ff-dax-pro, sans-serif; color: rgb(0, 104, 168); font-size: 1.563rem;\">Recycling</h2><p style=\"box-sizing: inherit;\">Bismuth is difficult to recycle because it is used in many dissipative applications, such as pigments and pharmaceuticals. It is recovered from the production processes for lead, copper, tin, silver and gold refining. At Umicores integrated smelter-refinery in Hoboken, Bismuth is recovered from the lead bullion exiting the lead blast furnace.</p><h2 style=\"box-sizing: inherit; margin-bottom: 1rem; line-height: 1.4; word-break: break-word; font-family: ff-dax-pro, sans-serif; color: rgb(0, 104, 168); font-size: 1.563rem;\"><br style=\"box-sizing: inherit;\">Properties</h2><p style=\"box-sizing: inherit;\">Bismuth is a hard, brittle, lustrous, metallic element with a pinkish tinge. It can be distinguished from all other metals by its color. Unlike most metals, its electrical resistivity is greater in the solid state than in the liquid state.</p><p style=\"box-sizing: inherit;\">Naturally occurring bismuth is found in small quantities throughout Earths crust both as a pure metal and combined with other elements in various compounds.</p><h2 style=\"box-sizing: inherit; margin-bottom: 1rem; line-height: 1.4; word-break: break-word; font-family: ff-dax-pro, sans-serif; color: rgb(0, 104, 168); font-size: 1.563rem;\"><br style=\"box-sizing: inherit;\">History</h2><p style=\"box-sizing: inherit;\">In the 15th-century writings of the German monk Basil Valentine, this element is referred to as Wismut, a term derived from the German weisse masse, meaning white substance. It was Latinized to bisemutum by the mineralogist Georgius Agricola, who recognized its distinctive qualities and described how to obtain it from its ores.&nbsp;</p><p style=\"box-sizing: inherit;\">The basic nitrate Bi(OH)<span style=\"box-sizing: inherit; font-size: 12px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">2</span>NO<span style=\"box-sizing: inherit; font-size: 12px; line-height: 0; position: relative; vertical-align: baseline; bottom: -0.25em;\">3</span>&nbsp;was used by painters in the 16th century and was known as blanc dEspagne. Industrial production of the metal began in Saxony in around 1830.</p></div></div></div></div>', 'uploads/blogs/serve/195471688886065.jpg', 'uploads/blogs/serve/961681688886065.webp', 'bismuth', 1, 1, '2023-07-09 07:01:05', '2023-07-09 07:01:05'),
(16, 'Cerium', '<div class=\"block block-header\" style=\"box-sizing: inherit; margin-top: 0px; color: rgb(41, 41, 41); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\"><div class=\"row justify-content-center\" style=\"box-sizing: inherit;\"><div class=\"col-lg-8\" style=\"box-sizing: inherit; min-height: 1px; width: 760px; flex-basis: 66.6667%; max-width: 66.6667%;\"><h1 style=\"box-sizing: inherit; margin-bottom: 1rem; line-height: 1.4; word-break: break-word; font-family: ff-dax-pro, sans-serif; color: rgb(0, 104, 168); font-size: 2.5rem;\">Cerium</h1></div></div></div><div class=\"block block-text\" style=\"box-sizing: inherit; margin-top: 0px; color: rgb(41, 41, 41); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\"><div class=\"row justify-content-md-center\" style=\"box-sizing: inherit;\"><div class=\"col col-lg-8\" style=\"box-sizing: inherit; min-height: 1px; width: 760px; flex-basis: 66.6667%; max-width: 66.6667%;\"><div class=\"wysiwyg\" style=\"box-sizing: inherit;\"><p style=\"box-sizing: inherit;\">Cerium was discovered in 1803 by Jns J. Berzelius and Wilhelm von Hisinger in Sweden, and independently in the same year by Martin Klaproth in Germany. Berzelius and Hisinger discovered the new element in a rare reddish-brown mineral now known as cerite, a cerium-lanthanide silicate.</p><p style=\"box-sizing: inherit;\">They named the new element cerium after the asteroid Ceres, which had been discovered just two years earlier. They called cerium oxide ceria.<br style=\"box-sizing: inherit;\"><br style=\"box-sizing: inherit;\"></p><h2 style=\"box-sizing: inherit; margin-bottom: 1rem; line-height: 1.4; word-break: break-word; font-family: ff-dax-pro, sans-serif; color: rgb(0, 104, 168); font-size: 1.563rem;\">Properties</h2><ul style=\"box-sizing: inherit;\"><li style=\"box-sizing: inherit;\">A reactive, soft, grey, lustrous metal that is malleable and ductile.</li><li style=\"box-sizing: inherit;\">When present in compounds, cerium exists in both the trivalent state (Ce3+, cerous, usually orange-red) and the tetravalent state (Ce4+, ceric, usually colourless).</li><li style=\"box-sizing: inherit;\">The metal tarnishes in moist air and reacts with water to form cerium hydroxide plus hydrogen gas.</li><li style=\"box-sizing: inherit;\">Small particles of the metal may ignite if a knife scratches the pure metal surface.</li><li style=\"box-sizing: inherit;\">It is attacked by alkali solutions and all other acids.</li><li style=\"box-sizing: inherit;\">Has a variable electronic structure: the energy of the inner 4f level is nearly the same as that of the 6s level, allowing variable occupancy of these two levels.&nbsp;<br style=\"box-sizing: inherit;\"><br style=\"box-sizing: inherit;\"></li></ul><h2 style=\"box-sizing: inherit; margin-bottom: 1rem; line-height: 1.4; word-break: break-word; font-family: ff-dax-pro, sans-serif; color: rgb(0, 104, 168); font-size: 1.563rem;\">Applications</h2><ul style=\"box-sizing: inherit;\"><li style=\"box-sizing: inherit;\">An alloy of cerium and lanthanum, with small amounts of neodymium and praseodymium (misch metal) combined with iron oxide and magnesium oxide is used as the&nbsp;<span style=\"box-sizing: inherit; font-weight: bolder;\">flint</span>&nbsp;in gas lighters.</li><li style=\"box-sizing: inherit;\">In nickel metal hydride (NiMH)&nbsp;<span style=\"box-sizing: inherit; font-weight: bolder;\">rechargeable batteries</span>&nbsp;for hybrid automobiles. The negative electrode (cathode) in NiMH batteries is a mixture of metal hydrides  typically a rare earth misch metal hydride containing praseodymium, neodymium, lanthanum and cerium.</li><li style=\"box-sizing: inherit;\">Cerium is used in<span style=\"box-sizing: inherit; font-weight: bolder;\">&nbsp;carbon-arc lighting</span>, especially in the motion picture industry.</li><li style=\"box-sizing: inherit;\">It is also used in&nbsp;<span style=\"box-sizing: inherit; font-weight: bolder;\">phosphors</span>&nbsp;for colour television screens and fluorescent lighting.</li><li style=\"box-sizing: inherit;\">Cerium oxide is used as an ingredient in&nbsp;<span style=\"box-sizing: inherit; font-weight: bolder;\">catalytic converters</span>&nbsp;to reduce carbon monoxide emissions in the exhaust fumes from automobiles.</li><li style=\"box-sizing: inherit;\">Cerium oxide, as a nanopowder, is added to diesel fuel to reduce sooty fumes and&nbsp;<span style=\"box-sizing: inherit; font-weight: bolder;\">improve engine performance</span>.</li><li style=\"box-sizing: inherit;\">It is used in the walls of&nbsp;<span style=\"box-sizing: inherit; font-weight: bolder;\">self-cleaning ovens</span>&nbsp;and is also used to polish glass surfaces.</li><li style=\"box-sizing: inherit;\">Flammacerium (cerium nitrate-silver sulphadiazine) is a cream to treat and prevent infections in extensive burn wounds. The cerium nitrate component&nbsp;<span style=\"box-sizing: inherit; font-weight: bolder;\">reduces immunosuppression</span>.<br style=\"box-sizing: inherit;\"><br style=\"box-sizing: inherit;\"></li></ul><h2 style=\"box-sizing: inherit; margin-bottom: 1rem; line-height: 1.4; word-break: break-word; font-family: ff-dax-pro, sans-serif; color: rgb(0, 104, 168); font-size: 1.563rem;\">Recycling</h2><p style=\"box-sizing: inherit;\">Rare earths are very challenging to recycle due partly to their very dispersed use.&nbsp;</p></div></div></div></div>', 'uploads/blogs/serve/999791688886233.jpg', 'uploads/blogs/serve/912781688886233.webp', 'cerium', 1, 1, '2023-07-09 07:03:53', '2023-07-09 07:03:53');
