: 0px; outline: 0px; padding: 0px; font-family: inherit; font-weight: 700; font-style: inherit; vertical-align: baseline;\">SOGO</span>&nbsp;group established the e-waste management and IT asset disposition solutions through its associate sister concern&nbsp;<span style=\"margin: 0px; border: 0px; outline: 0px; padding: 0px; font-family: inherit; font-weight: 700; font-style: inherit; vertical-align: baseline;\">SOGO SYNERGY PVT. LTD</span></span><span style=\"margin: 0px; border: 0px; outline: 0px; padding: 0px; font-family: inherit; font-weight: 700; font-style: inherit; vertical-align: baseline;\">. &nbsp;</span><span style=\"margin: 0px; border: 0px; outline: 0px; padding: 0px; font-family: inherit; font-weight: inherit; font-style: inherit; vertical-align: baseline;\">Since then, the company has served the country as Cradle-to-Cradle solution providers. Not only, do they sell the computer parts and accessories, but also, they provide the means to efficiently dispose or recycle the same once they attain the end of life.&nbsp;<span style=\"margin: 0px; border: 0px; outline: 0px; padding: 0px; font-family: inherit; font-weight: 700; font-style: inherit; vertical-align: baseline;\">SOGO SYNERGY PVT. LTD.</span>&nbsp;is committed to maintaining quality, trust, and reliability for bringing additional values to the customers investments. Their efforts are entirely dedicated to serving their customers to the highest level of satisfaction.</span></p></div></div></div></div></div></div></div></div></section><section data-particle_enable=\"false\" data-particle-mobile-disabled=\"false\" class=\"elementor-section elementor-top-section elementor-element elementor-element-3c52b2a elementor-section-boxed elementor-section-height-default elementor-section-height-default\" data-id=\"3c52b2a\" data-element_type=\"section\" style=\"--flex-direction: initial; --flex-wrap: initial; --justify-content: initial; --align-items: initial; --align-content: initial; --gap: initial; --flex-