"margin: 0px; border: 0px; outline: 0px; padding: 0px; font-family: inherit; font-weight: inherit; font-style: inherit; vertical-align: baseline;\"><p style=\"margin-right: 0px; margin-bottom: 18px; margin-left: 0px; border: 0px; outline: 0px; padding: 0px; font-family: inherit; font-weight: inherit; font-style: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; border: 0px; outline: 0px; padding: 0px; font-family: inherit; font-weight: 700; font-style: inherit; vertical-align: baseline;\">Mr G Jayamuni Rao,</span><span style=\"margin: 0px; border: 0px; outline: 0px; padding: 0px; font-family: inherit; font-weight: inherit; font-style: inherit; vertical-align: baseline;\">&nbsp;the</span><span style=\"margin: 0px; border: 0px; outline: 0px; padding: 0px; font-family: inherit; font-weight: 700; font-style: inherit; vertical-align: baseline;\"><span style=\"margin: 0px; border: 0px; outline: 0px; padding: 0px; font-family: inherit; font-weight: inherit; font-style: inherit; vertical-align: baseline;\">&nbsp;</span>Chairman &amp; Managing Director<span style=\"margin: 0px; border: 0px; outline: 0px; padding: 0px; font-family: inherit; font-weight: inherit; font-style: inherit; vertical-align: baseline;\">&nbsp;</span></span><span style=\"margin: 0px; border: 0px; outline: 0px; padding: 0px; font-family: inherit; font-weight: inherit; font-style: inherit; vertical-align: baseline;\">of&nbsp;<span style=\"margin: 0px; border: 0px; outline: 0px; padding: 0px; font-family: inherit; font-weight: 700; font-style: inherit; vertical-align: baseline;\">SOGO</span>&nbsp;Group of Companies, is the guiding light enabling the continuous advancement of the company on the roads of success. &nbsp;He was judicious in gauging the fact that advanced technologies are the major contributors in discarding older electronic equipment as waste and that recycling is one critical aspect which is being overlooked. Until now, very few companies have realised the potential of this emerging business. He considered that the investment in this new sector would lead to a win-win situation for e-waste generator, recycler, and the government.</span><br><span style=\"margin: 0px; border: 0px; outline: 0px; padding: 0px; font-family: inherit; font-weight: inherit; font-style: inherit; vertical-align: baseline;\">Moreover, the fact that it will further support the country tremendously by putting e-waste into productive use served as the motivation he required for setting of e-waste management business. The dedication and zeal to achieve success can be measured by the fact that he started his business journey as a travel agent but today, he leads a 300 -crore worth business of&nbsp;<span style=\"margin: 0px; border: 0px; outline: 0px; padding: 0px; font-family: inherit; font-weight: 700; font-style: inherit; vertical-align: baseline;\">SOGO</span>&nbsp;Group of Companies.</span></p></div></div></div></div></div></div></div></div></section><section data-particle_enable=\"false\" data-particle-mobile-disabled=\"false\" class=\"elementor-section elementor-top-section elementor-element elementor-element-cc28f9a elementor-section-boxed elementor-section-height-default elementor-section-height-default\" data-id=\"cc28f9a\" data-element_type=\"section\" style=\"--flex-direction: initial; --flex-wrap: initial; --justify-content: initial; --align-items: initial; --align-content: initial; --gap: initial; --flex-basis: initial; --flex-grow: initial; --flex-shrink: initial; --order: initial; --align-self: initial; -webkit-box-orient: vertical; -webkit-box-direction: normal; flex-direction: var(--flex-direction); flex-wrap: var(--flex-wrap); -webkit-box-pack: var(--justify-content); justify-content: var(--justify-content); -webkit-box-align: var(--align-items); align-items: var(--align-items); align-content: var(--align-content); gap: var(--gap); flex-basis: var(--flex-basis); -webkit-box-flex: var(--flex-grow); flex-grow: var(--flex-grow); flex-shrink: var(--flex-shri